/** @format */

import React from "react";
import styled from "styled-components";
import MenuCard from "./MenuCard";
const MenuBlock = styled.div`
  width: 100%;

  margin-bottom: 5vh;
`;

const MenuBox = () => {
  return (
    <MenuBlock>
      <MenuCard />
    </MenuBlock>
  );
};

export default MenuBox;
